import { useEffect } from "react";

import BearContainer from "./BearContainer";

const BearRow = (props) => {

  useEffect(() => {
    if (props.openApp == false) {
      setTimeout(() => {
        setOpenApp(true);
      }, 500);
    }
  }, [props.openApp]);

  return (
    <div className="downer-row" style={props.openApp ? {width: '25%'} : {width: '50%'}}>
         {props.downerStocks.map(data =>
               <BearContainer openApp={props.openApp} toggleActiveDowner={props.toggleActiveDowner} key={data.id} data={data}/>
               )}    
    </div>
  );
};

export default BearRow;
